%[text] ### Pendulum system
%[text] #### Define energy and system equations using symbolic variables
%[text] $x\_1$ is the angle of the pendulum
%[text] $x\_2$ is the angulare velocity of the pendulum $(\\dot x\_1 = x\_2)$
%[text] m: mass, l; length of the pendulum, g: gravitational acceleration, b: friction coefficient
syms m l g b real
syms x1 x2 real
x = [x1;x2];
%[text] Energy
V = m*g*l*(1-cos(x1)) + 1/2*m*l^2*x2.^2 %[output:555bda8c]
%[text] System equation $\\left( \\matrix{ \\dot x\_1 \\cr \\dot x\_2} \\right) = f(x\_1,x\_2)$
f = [ %[output:group:8756c6e8] %[output:42571eb5]
    x2 %[output:42571eb5]
    -g/l*sin(x1) - b/m*x2 %[output:42571eb5]
    ] %[output:group:8756c6e8] %[output:42571eb5]
%%
%[text] ## Generate and plot energy function
m = 1;
l = 1;
g = 10;
b = 0.2;
V_ = subs(V);
V_fh = matlabFunction(V_,'Vars',[x1;x2]);

[x1_val,x2_val] = meshgrid(linspace(-3*pi,3*pi,151),linspace(-8,8,151));
V_val = V_fh(x1_val,x2_val);

surf(x1_val,x2_val,V_val) %[output:70483435]
shading interp %[output:70483435]
%%
%[text] ## Generate an ODE-compatible function
%[text] First, specify parameters:
m = 1;
l = 1;
g = 10;
b = 0.2;
f_ = subs(f) %[output:46beceb4]
% !!!!!!!!!!!!!!!!!!!!
f_ode = matlabFunction(f_,'Vars',{sym('t'),x}) %[output:79e025b0]
[t,xx] = ode45(f_ode,[0,10],[-5,10]);
%[text] Solution as a time function:
plot(t,xx) %[output:8e46929f]
xlabel t %[output:8e46929f]
ylabel 'x1, x2' %[output:8e46929f]
%[text] Phase diagram:
plot(xx(:,1),xx(:,2)) %[output:89205572]
xlabel 'x1 (angle)' %[output:89205572]
ylabel 'x2 (angular velocity)' %[output:89205572]
%%
%[text] ## Generate a QUIVER compatible function
m = 1;
l = 1;
g = 10;
b = 0.2;
f_ = subs(f) %[output:7020be78]
% !!!!!!!!!!!!!!!!!!!!
f1 = matlabFunction(f_(1),'Vars',x) %[output:94afaa9f]
f2 = matlabFunction(f_(2),'Vars',x) %[output:62fe4133]
[x1_val,x2_val] = ndgrid(linspace(-3*pi,3*pi,31),linspace(-10,10,31));

f1_val = f1(x1_val,x2_val);
f2_val = f2(x1_val,x2_val);
quiver(x1_val,x2_val,f1_val,f2_val) %[output:845a6837]
xlabel 'x1 (angle)' %[output:845a6837]
ylabel 'x2 (angular velocity)' %[output:845a6837]
%[text] Normalize arrows:
r = sqrt(f1_val.^2 + f2_val.^2);

f1_val = f1_val ./ r;
f2_val = f2_val ./ r;

quiver(x1_val,x2_val,f1_val,f2_val) %[output:1335e324]
axis tight %[output:1335e324]
xlabel 'x1 (angle)' %[output:1335e324]
ylabel 'x2 (angular velocity)' %[output:1335e324]
%%
%[text] ## Visualize the stream of the vector field
%[text] Using the same construction as used for quiver, but creating a more dense grid and there is not need to normalize.
[x1_val,x2_val] = meshgrid(linspace(-3*pi,3*pi,331),linspace(-10,10,331));

f1_val = f1(x1_val,x2_val);
f2_val = f2(x1_val,x2_val);

figure %[output:65da6f33]
streamslice(x1_val,x2_val,f1_val,f2_val) %[output:65da6f33]
xlabel 'x1 (angle)' %[output:65da6f33]
ylabel 'x2 (angular velocity)' %[output:65da6f33]

